import { Link } from "react-router-dom";
const AllQuotes = ()=>{
    return(<ul>
            <li><Link to='/allquotes/q1'>Quote1</Link></li>
            <li><Link to='/allquotes/q2'>Quote2</Link></li>
            <li><Link to='/allquotes/q3'>Quote3</Link></li>
    </ul>)
}
export default AllQuotes;
